        content: '<div class="oKdM2c"><div id="h.p_YSXchcpbnWY4" class="hJDwNd-AhqUyc-qWD73c jXK9ad D2fZ2 OjCsFc wHaque GNzUNc"><div class="jXK9ad-SmKAyb jXK9ad-SmKAyb-c4YZDc"><div class="tyJCtd mGzaTb baZpAe"><p id="h.p_6Avk594bnWY5" class="zfr3Q RuayVd" style="text-align: center;"><strong>Opción 1: Lista a partir de un Intervalo</strong></p><p id="h.p_EmTku9j4nWpx" class="zfr3Q RuayVd" style="text-align: justify; white-space: normal;"><strong>Paso 1:</strong>En la barra de Menús, haz clic sobre el menú "Datos."</p><p id="h.p_1u6JpGe1nWpx" class="zfr3Q RuayVd" style="text-align: justify; white-space: normal;"><strong>Paso 2: </strong>Selecciona la opción "Validación de Datos".</p><p id="h.p_ZQxBqff7nWpx" class="zfr3Q RuayVd" style="text-align: justify; white-space: normal;"><strong>Paso 3: </strong>En el campo "intervalo de Celdas", selecciona el intervalo donde quieres crear la lista y haz clic en "Aceptar".</p><p id="h.p_Uya0QbLlnWpy" class="zfr3Q RuayVd" style="text-align: justify; white-space: normal;"><strong>Paso 4: </strong>En el campo Criterio, elige "Lista a partir de un intervalo" y selecciona los datos o lista que ya tienes creada.</p><p id="h.p_RCgCEg8EnWpy" class="zfr3Q RuayVd" style="text-align: justify; white-space: normal;"><strong>Paso 5:</strong> Selecciona la forma de validar los datos (Mostrar Aviso o Rechazar entrada) y haz clic en Guardar.</p></div></div></div><div id="h.p_FylgZKTinQca" class="hJDwNd-AhqUyc-qWD73c jXK9ad D2fZ2 OjCsFc wHaque GNzUNc"><div class="jXK9ad-SmKAyb jXK9ad-SmKAyb-c4YZDc"><div class="tyJCtd mGzaTb baZpAe"><p id="h.p_s-pEdpFAnQcc" class="zfr3Q RuayVd" style="text-align: center;"><strong>Opción 2: A partir de una Lista de Elementos.</strong></p><p id="h.p_jNW7midZnSIS" class="zfr3Q RuayVd" style="text-align: justify; white-space: normal;"><strong>Paso 1:</strong>En la barra de Menús, haz clic sobre el menú "Datos."</p><p id="h.p_9PxgfPPInSIT" class="zfr3Q RuayVd" style="text-align: justify; white-space: normal;"><strong>Paso 2: </strong>Selecciona la opción "Validación de Datos".</p><p id="h.p_eMl9I54dnSIU" class="zfr3Q RuayVd" style="text-align: justify; white-space: normal;"><strong>Paso 3: </strong>En el campo "intervalo de Celdas", selecciona el intervalo donde quieres crear la lista y haz clic en "Aceptar".</p><p id="h.p_FoMPgUTYnSIV" class="zfr3Q RuayVd" style="text-align: justify; white-space: normal;"><strong>Paso 4: </strong>En el campo Criterio, elige "Lista de elementos" y escribe los elementos separados por comas.</p><p id="h.p_Xdd6hRiInSIV" class="zfr3Q RuayVd" style="text-align: justify; white-space: normal;"><strong>Paso 5:</strong> Selecciona la forma en que quieres validar los datos (Mostrar Aviso o Rechazar entrada) y haz clic en Guardar.</p></div></div></div></div>'
